'use strict';
// Complete the steadyGene function below.
const getBalance = (gene) => {
    /* This function checks the gene string balance, i.e. The number of times that a characters comes up */
    let l = gene.length;
    let balance = {'A': 0, 'C': 0, 'G': 0, 'T':0};
    for (let i = 0; i < l; i++) {
        let c = gene[i];
        ++balance[c];	
    }
    return balance;
};

const getBreakingChars = (balance, optimal) => {
    /*Hints the solution by highlighting the unbalance*/
    let max = 0;
    let chars = {};
    Object.keys(balance).forEach( c => {
	let unbalance = balance[c] - optimal;
	if (unbalance > 0) {
	    max += unbalance;
	    chars[c] = unbalance;
	}
	});

    return [max, chars];
}

const compareObjects = (compareFrom, compareTo) => {
    let f = JSON.stringify(compareFrom);
    let t = JSON.stringify(compareTo);
    
    return f === t;
};

const matches = (target, chars) => {
    let times = {};
    let kChars = Object.keys(chars);
    
    for (let i = 0; i < target.length; i++) {	
	if (kChars.indexOf(target[i]) !== -1) {
	    if (times[target[i]])
		++times[target[i]];
	    else times[target[i]] = 1;
	}
    }
    
    return compareObjects(chars, times);
};

function steadyGene(gene) {
    let minSubsize = 0;
    let optimal = gene.length / 4; //Number of times that each char should come up
    let balance = getBalance(gene);   
    
    let breakingChars = getBreakingChars(balance, optimal);
    
    //If it's not balanced the first element is more that zero
    if (breakingChars[0] !== 0) {
        minSubsize = Number.MAX_VALUE;
        let unbalance = breakingChars[0];
        let c = breakingChars[1];
        console.log(c);
        for (let minSize = unbalance; minSize < gene.length; minSize++) {
            for (let i = 0; (i + minSize) < gene.length; i++) {
                let substr = gene.substring(i, minSize + i);		
                let isMatch = matches(substr, c);		
                if (isMatch && minSize < minSubsize) {
                    minSubsize = minSize;
                }
            }
        }
    } 
    return minSubsize;
}

